== Lizenz ==
{{CC-BY-SA}}


[[Kategorie:Bilder]]

{{T|MessageBox}} ist eine Vorlage für Nachrichten-Boxen.



Es ist mit Klassen, Inline-Stilen und bereitgestellten CSS-Selektoren in hohem Maße anpassbar. Optionale Funktionen wie ein Bild, ein linker Rand, rechtsseitiger Text (z.B. für Shortcuts) und eine Ausblendefunktion sind auch enthalten.

Es verwendet die [[w:c:de.cummunity:Hilfe:Lua|Lua-Vorlagensprache]], und weitere Informationen findest du [[w:c:dev:Global_Lua_Modules/Mbox|auf der Seite Globales Lua-Modul]]. Diese Version ist modifiziert, um einen Anfangsstil zu erzeugen, der auf dem Basisstil aus dem Modul basiert. Um den vollen Funktionsumfang dieses Moduls zu nutzen und den Standardstil zu entfernen, entfernst du die angegebenen Teile von [[Modul:Mbox]].

'''Eine traditionellere Wikitext-Version dieser Vorlage findest du im [[w:c:templates:Template:Ambox|Templates Wiki]]'''.

== Parameter ==
Für Beispiele, um diese Parameter zu nutzen, siehe [[#Beispiele]].
{| class="article-table" style="width: 100%"
! Parametername
! Beschreibung
! Benötigt?
! Standard
|-
| <code>class</code>
| Zusätzlich Klassen im das <code>.mbox</code>-Element.
| Nein
| —
|-
| <code>bordercolor</code>
| Die Farbe der linken Randfarbe.
| Nein
| Stylesheet-Standard
|-
| <code>type</code>
| Typ der mbox wie in CSS mit Variablen deklariert. Beeinflusst die Farbe des linken Randes. Siehe [[#Typen verwenden]].
| Nein
| —
|-
| <code>bgcolor</code>
| Hintergrundfarbe der mbox.
| Nein
| Stylesheet-Standard
|-
| <code>style</code>
| zusätzliche Inline-Stile des <code>.mbox</code>-Element.
| Nein
| —
|-
| <code>image</code>
| Ein Bild, das links vom gesamten Textinhalt hinzugefügt wird.
| Nein
| —
|-
| <code>imagewidth</code>
| Die Breite des Bildes (die Höhe passt sich automatisch an).
| Nein
| <code>60px</code>
|-
| <code>imagelink</code>
| Der Link, auf den das Bild zeigt (könnte z.B. auf die entsprechende Wartungskategorie verweisen). Wenn nicht vorhanden, kann das Bild nicht angeklickt werden.
| Nein
| —
|-
| <code>header</code>
| Die Kopfzeile (fetter Text am oberen Rand). Dies wird normalerweise verwendet, um das Thema der mbox selbst sehr kurz zu erläutern, da beim Schließen der mbox nur die Kopfzeile angezeigt wird.
| Nein
| —
|-
| <code>text</code>
| Nicht fett gedruckter Text unterhalb der Kopfzeile, der in der Regel verwendet wird, um das Thema der mbox weiter oder zusätzlich zu erläutern. Wenn die mbox geschlossen wird, wird dieser Text ausgeblendet.
| Nein
| —
|-
| <code>comment</code>
| Kleinerer, nicht fettgedruckter Text unterhalb des Haupttextes, der in der Regel verwendet wird, um zusätzliche Links oder Kontext zu der Bekanntmachung hinzuzufügen. Wenn die mbox geschlossen wird, wird dieser Text ausgeblendet.
| Nein
| —
|-
| <code>aside</code>
| Text innerhalb einer kleinen Zuordnung auf der rechten Seite, getrennt durch einen hellgrauen Rand. Am häufigsten verwendet, um Abkürzungen zu der betreffenden Seite anzuzeigen (z.B. auf Richtlinienseiten). Wenn die mbox geschlossen wird, wird dieser Text ausgeblendet.
| Nein
| —
|-
| <code>id</code>
| Standardmäßig schließt ein Schließen-Button alle mboxes auf der Seite. Um dies jedoch zu ändern, kann dieser Parameter verwendet werden, der als Name der mbox-Implementierung angegeben wird (z.B. hätte "Vorlage:Aufraümen" <code><<nowiki>|id=cleanup</nowiki></code>).
| Nein
| —
|-
| <code>collapsed</code>
| Standardmäßig wird die mbox nicht zugeklappt, und der vollständige Inhalt wird angezeigt. Um dies zu ändern, kann dieser Parameter jedoch verwendet werden, um eine mbox als standardmäßig zugeklappt zu setzen (z.B. würde <code><nowiki>|collapsed=true</nowiki></code> die mbox als standardmäßig zugeklappt setzen).
| Nein
| —
|}

== Design ==
Einige Communitys möchten möglicherweise das Aussehen der mboxes anpassen. Die gängigsten Styling-Optionen sind in CSS dargestellt.

<syntaxhighlight lang="css" class="mw-collapsible mw-collapsed">
.mbox {
    /* Hintergrund der gesamten mbox */;
    background-color: ;

    /* Randfarbe der gesamten mbox */
    border-color: ;

    /* Randdicke der gesamten mbox */
    border-width: ;

    /* die Standardfarbe für den dicken linken Rand; beachte, dass dies innerhalb der Vorlage mit dem Parameter "color" geändert werden kann */
    border-left-color: ;

    /* die Abrundung der Ecken */;
    border-radius: ;

    /* die Basisschriftgröße der mbox */
    font-size: ;
}

.mbox__content {
    /* der Innenabstand der mbox */
    padding: ;
}

.mbox__content__image {
    /* die Mindestbreite des Bildes der mbox (falls größer, verwende den Parameter "imagewidth" in der Vorlage) */
    width: ;

    /* der Abstand links vom Text (d.h. rechts vom Bild) */
    padding-right: ;
}

.mbox__content__text__comment {
    /* die Größe des Textes im Parameter "Kommentar" */
    font-size: ;
}

.mbox__content__aside {
    /* alle besonderen Modifikationen im "aside"-Bereich können hier vorgenommen werden. */

    /* die maximale Breite des Seitenbereichs */
    width: ;
}

.mbox__close {
    /* das Erscheinen des Schließsymbols hier */
}

.mbox__close:after {
    /* überschreibe hier "content", wenn du nicht möchtest, dass das Schließsymbol × ist */
    content: '';
}

.mw-collapsed + .mbox__close {
   /* Änderungen am Schließsymbol, wenn die Box geschlossen ist */
}

.mw-collapsed + .mbox__close:after {
   /* überschreibe hier " content ", wenn du nicht möchtest, dass das Schließsymbol + ist, wenn die Box geschlossen ist */
   content: '';
}
</syntaxhighlight>

; Technical notes
* Additional inline styles to the root <code>.mbox</code> element can be achieved via the <code>style</code> parameter in the template.

== Beispiele ==
=== Basis MessageBox ===
<pre>
{{MessageBox
|header      = Überschrift hier
|text        = Normaler Text hier
|id          = test1
}}</pre>

Ergibt:

{{#invoke:Mbox|main
|header      = Überschrift hier
|text        = Normaler Text hier
|id          = test1
}}

=== Typen verwenden ===
Um Typen zu verwenden, müssen CSS-Variablen hinzugefügt werden, wie z.B:
<syntaxhighlight lang="css">
:root {
    --type-important: rgba(200, 0, 0, 0.8);
    --type-moderate: rgba(233, 124, 47, 0.8);
    --type-minor: rgba(241, 197, 37, 0.8);
}
</syntaxhighlight>

Falls hinzugefügt:

<pre>
{{MessageBox
|header = Überschrift hier
|type   = important
|text   = Normaler Text hier
|id     = test2
}}</pre>

Ergibt:

{{#invoke:Mbox|main
|header = Überschrift hier
|type   = important
|text   = Normaler Text hier
|id     = test2
}}

Je nach deinem Styling gibt es im obigen Beispiel möglicherweise keinen visuellen Unterschied.

=== Mit einem Bild ===
<pre>
{{MessageBox
|header     = Überschrift hier
|text       = Normaler Text hier
|image      = Wiki.png
|imagelink  = 
|imagewidth = 50px
|id         = test3
}}</pre>

Ergibt:

{{#invoke:Mbox|main
|header     = Überschrift hier
|text       = Normaler Text hier
|image      = Wiki.png
|imagelink  = 
|imagewidth = 50px
|id         = test3
}}

=== Mit einem Seitenbereich ===
<pre>
{{MessageBox
|header = Überschrift hier
|type   = important
|text   = Normaler Text hier
|aside  = Seitlicher Text hier
|id     = test4
}}</pre>

Ergibt:

{{#invoke:Mbox|main
|header = Überschrift hier
|type   = important
|text   = Normaler Text hier
|aside  = Seitlicher Text hier
|id     = test4
}}

=== Standardstil ===
<pre>
{{MessageBox
|header  = Überschrift hier
|text    = Normaler Test hier
|comment = Kommentar hier
|image   = Wiki.png
|aside   = Seitlicher Text hier
|id      = standard
}}</pre>

Ergibt:

{{#invoke:Mbox|main
|header  = Überschrift hier
|text    = Normaler Test hier
|comment = Kommentar hier
|image   = Wiki.png
|aside   = Seitlicher Text hier
|id      = standard
}}
